function create_multipart_upload(
    Bucket, Key; aws_config::AbstractAWSConfig=global_aws_config()
)
    return s3(
        "POST",
        "/$(Bucket)/$(Key)?uploads";
        aws_config=aws_config,
        feature_set=SERVICE_FEATURE_SET,
    )
